import { Dialog, withStyles, Box, makeStyles } from "@material-ui/core";

const useStyles = makeStyles({
  component: {},
  leftComponent: {},
  rightComponent: {},
});

const style = {
  dialogPaper: {
    height: "95%",
    width: "91%",

    boxShadow: "none",
    borderRadius: 0,
    maxHeight: "100%",
    maxWidth: "100%",
  },
};

const ChatBox = ({ classes }) => {
  return (
    <Dialog open={true} classes={{ paper: classes.dialogPaper }}>
      <Box>
        <Box></Box>
        <Box></Box>
      </Box>
    </Dialog>
  );
};

export default withStyles(style)(ChatBox);
